@app.route("/spam",methods=['POST','GET'])
def spam():
    if request.method=="POST":
        name=request.form['name']
        msg=request.form['message']
        pred=predict_spam(msg)
        return render_template("spam-detect.html",prediction=pred)
    else:
        return render_template("spam-detect.html",prediction=None)

def predict_spam(val):
    cv=count_vect.transform([val])
    val=cv.toarray()
    return spam_model.predict(val)

@app.route("/credit_card",methods=["POST","GET"])
def credit_card():
    if request.method=="POST":
        t=request.form['trans_num']
        c=request.form['category']
        a=request.form['amt']
        tr=request.form['trans_date_trans_time']
        u=request.form['unix_time']
        pred=credit_pred(t,c,a,tr,u)
        return render_template("credit-card.html",prediction=pred)
    else:
        return render_template("credit-card.html",prediction=None)

def credit_pred(t,c,a,tr,u):
    model=joblib.load('credit-card-fraud.joblib')
    return model.predict([[t,c,a,tr,u]])
    

